import './App.css';
import { BrowserRouter, Routes, Route} from "react-router-dom";
import App from "./components/App";
import Nav from "./components/Nav";
import About from "./components/About";
import Deals from "./components/Deals";
import Info from "./components/Info"
import Basket from "./components/Basket"
import { ItemsList } from "./components/Deals";



const RouteSwitch = () => {
    const [shopBasket, setBasket] = useState([]);
    console.log(shopBasket.then(res => res))
    return(
        <BrowserRouter>
            <Nav />
            <Routes>
                <Route path="/" element={<App />} />
                <Route path="/about" element={<About />} />
                <Route path="/deals/" element={<Deals setBasket={setBasket} shopBasket={shopBasket}/>} />
                <Route path="/deals/:id" element={<Info />} />
                <Route path="/basket" element={<Basket />} />
                {/* <Route path="/info" element={<Info />} /> */}

            </Routes>
        </BrowserRouter>

    )
}

export default RouteSwitch
